import React, { Component } from 'react';
class Footer extends Component {

    render() {
        return (
<div className="footer">
            <h1>James Bond Shop</h1>
            <h2>DVDs & Blurays for all James Bond fans</h2>
            <p>A Javascript, React, Bootstrap, Node JS, AWS, Mysql project by Simon Cobb</p>
            <p>(c) 2019 Simon Cobb </p>

</div>
        )
    }

}
export default Footer;
